  true,\n\t\"url\": null,\n\t\"notes\": \"This 2009 version represents the 13th iteration
  of the RECS program. First conducted in 1978, the Residential Energy Consumption
  Survey is a national sample survey that collects energy-related data for housing
  units occupied as a primary residence and the households that live in them. Data
  were collected from 12,083 households selected at random using a complex multistage,
  area-probability sample design. The sample represents 113.6 million U.S. households,
  the Census Bureau's statistical estimate for all occupied housing units in 2009
  derived from their American Community Survey (ACS).\",\n\t\"license_title\": \"Other
